import React, {Fragment} from "react";
import {
  withGoogleMap,
  GoogleMap,
  withScriptjs,
  Marker,
  Circle
} from "react-google-maps";

const Map = props => {
    var options={
        strokeColor: '#FF0000',
        strokeOpacity: 0.8,
        strokeWeight: 2,
        fillColor: '#FF0000',
        fillOpacity: 0.35,
    }

    return (
      <GoogleMap
        defaultZoom={props.zoom}
        defaultCenter={props.center}
      >
        {props.places.map(place => {
          return (
            <Fragment key={place.id}>
              {/* <Marker
                position={{
                  lat: parseFloat(place.center.lat),
                  lng: parseFloat(place.center.lng)
                }}
              /> */}
              <Circle
                defaultCenter={{
                  lat: parseFloat(place.center.lat),
                  lng: parseFloat(place.center.lng)
                }}
                radius={place.Confirmed*70}
                options={options}
              />
            </Fragment>
          );
        })}
      </GoogleMap>
    );
}

export default withScriptjs(withGoogleMap(Map));
